@import "../vars";

/* Interaction Cues
----------------------------------*/
.ui-state-disabled {
  cursor: default !important;
  pointer-events: none;
}

/* Misc visuals
----------------------------------*/

/* Overlays */
.ui-widget-overlay {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
}

/* Component containers
----------------------------------*/
.ui-widget {
  font-family: $font_family;
  font-size: $font_size;
}
.ui-widget .ui-widget {
  font-size: $font_size;
}
.ui-widget input,
.ui-widget select,
.ui-widget textarea,
.ui-widget button {
  font-family: $font_family;
  // font-size: $font_size;
}
.ui-widget.ui-widget-content {
  border: 1px solid $button_border_color;
}
.ui-widget-content {
  border: 1px solid $button_border_color;
  background: $background_color;
  color: $button_font_color;
}
.ui-widget-content a {
  color: $button_font_color;
}
.ui-widget-header {
  border: 1px solid $button_border_color;
  // background: #cccccc url("images/ui-bg_highlight-soft_75_cccccc_1x100.png") 50%
  //   50% repeat-x;
  color: $button_font_color;
  font-weight: bold;
}
.ui-widget-header a {
  color: $button_font_color;
}

/* Interaction states
----------------------------------*/
.ui-state-default,
.ui-widget-content .ui-state-default,
.ui-widget-header .ui-state-default,
.ui-button,

/* We use html here because we need a greater specificity to make sure disabled
works properly when clicked or hovered */
html .ui-button.ui-state-disabled:hover,
html .ui-button.ui-state-disabled:active {
  border: 1px solid $button_border_color;
  // background: #e6e6e6 url("images/ui-bg_glass_75_e6e6e6_1x400.png") 50% 50%
  //   repeat-x;
  font-weight: normal;
  color: $font_disabled_color;
}
.ui-state-default a,
.ui-state-default a:link,
.ui-state-default a:visited,
a.ui-button,
a:link.ui-button,
a:visited.ui-button,
.ui-button {
  color: $font_disabled_color;
  text-decoration: none;
}
.ui-state-hover,
.ui-widget-content .ui-state-hover,
.ui-widget-header .ui-state-hover,
.ui-state-focus,
.ui-widget-content .ui-state-focus,
.ui-widget-header .ui-state-focus,
.ui-button:hover,
.ui-button:focus {
  border: 1px solid $button_border_color;
  // background: #dadada url("images/ui-bg_glass_75_dadada_1x400.png") 50% 50%
  //   repeat-x;
  font-weight: normal;
  color: $button_font_color;
}
.ui-state-hover a,
.ui-state-hover a:hover,
.ui-state-hover a:link,
.ui-state-hover a:visited,
.ui-state-focus a,
.ui-state-focus a:hover,
.ui-state-focus a:link,
.ui-state-focus a:visited,
a.ui-button:hover,
a.ui-button:focus {
  color: $button_font_color;
  text-decoration: none;
}

.ui-visual-focus {
  box-shadow: 0 0 3px 1px $color-blue;
}
.ui-state-active,
.ui-widget-content .ui-state-active,
.ui-widget-header .ui-state-active,
a.ui-button:active,
.ui-button:active,
.ui-button.ui-state-active:hover {
  border: 1px solid $button_border_color;
  // background: $background_color url("images/ui-bg_glass_65_ffffff_1x400.png") 50% 50%
  //   repeat-x;
  font-weight: normal;
  color: $button_font_color;
}

.ui-state-active a,
.ui-state-active a:link,
.ui-state-active a:visited {
  color: $button_font_color;
  text-decoration: none;
}

/* Interaction Cues
----------------------------------*/
.ui-state-highlight,
.ui-widget-content .ui-state-highlight,
.ui-widget-header .ui-state-highlight {
  border: 1px solid $button_border_color;
  // background: #fbf9ee url("images/ui-bg_glass_55_fbf9ee_1x400.png") 50% 50%
  //   repeat-x;
  color: $button_border_color;
}
.ui-state-checked {
  border: 1px solid $button_border_color;
  background: $color-sky-dark;
}
.ui-state-highlight a,
.ui-widget-content .ui-state-highlight a,
.ui-widget-header .ui-state-highlight a {
  color: $button_border_color;
}
.ui-state-error,
.ui-widget-content .ui-state-error,
.ui-widget-header .ui-state-error {
  border: 1px solid $color-red-dark;
  // background: #fef1ec url("images/ui-bg_glass_95_fef1ec_1x400.png") 50% 50%
  //   repeat-x;
  color: $color-red-dark;
}
.ui-state-error a,
.ui-widget-content .ui-state-error a,
.ui-widget-header .ui-state-error a {
  color: $color-red-dark;
}
.ui-state-error-text,
.ui-widget-content .ui-state-error-text,
.ui-widget-header .ui-state-error-text {
  color: $color-red-dark;
}
.ui-priority-primary,
.ui-widget-content .ui-priority-primary,
.ui-widget-header .ui-priority-primary {
  font-weight: bold;
}
.ui-priority-secondary,
.ui-widget-content .ui-priority-secondary,
.ui-widget-header .ui-priority-secondary {
  opacity: 0.7;
  filter: Alpha(Opacity=70); /* support: IE8 */
  font-weight: normal;
}
.ui-state-disabled,
.ui-widget-content .ui-state-disabled,
.ui-widget-header .ui-state-disabled {
  opacity: 0.35;
  filter: Alpha(Opacity=35); /* support: IE8 */
  background-image: none;
}

/* Misc visuals
----------------------------------*/

/* Corner radius */
.ui-corner-all,
.ui-corner-top,
.ui-corner-left,
.ui-corner-tl {
  border-top-left-radius: 4px;
}
.ui-corner-all,
.ui-corner-top,
.ui-corner-right,
.ui-corner-tr {
  border-top-right-radius: 4px;
}
.ui-corner-all,
.ui-corner-bottom,
.ui-corner-left,
.ui-corner-bl {
  border-bottom-left-radius: 4px;
}
.ui-corner-all,
.ui-corner-bottom,
.ui-corner-right,
.ui-corner-br {
  border-bottom-right-radius: 4px;
}

/* Overlays */
.ui-widget-overlay {
  background: $button_border_color;
  opacity: 0.3;
  filter: Alpha(Opacity=30); /* support: IE8 */
}
.ui-widget-shadow {
  -webkit-box-shadow: -8px -8px 8px $button_border_color;
  box-shadow: -8px -8px 8px $button_border_color;
}

